import { Link } from "react-router-dom";

function MainNav() {
  return (
    <header>
      <div>Saif</div>
      <nav>
        <ul>
          <li>
            <Link to="/">All Meetups</Link>
          </li>
          <li>
            <Link to="/new-meetups">New Meetups</Link>
          </li>
          <li>
            <Link to="/favs">My Favourites</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNav;
